import { Header } from "../Header/Header.js";
import "./Home.css";

const Home = () => {
    return (
        <div id={ "home" }>
            <Header siteName={ "Domov" } />
            <h1 className={ "secondary-title" }>Chceš sa naučiť programovať?</h1>
        </div>
    )
}

export { Home };
